    const [count, setCount] = useState(0)


    return (
        <div className="fixed inset-0 flex flex-col items-center justify-center">
            <Header/>
            <img className="w-24 h-20" src={notFoundImg}/>
            <p className="text-black font-bold text-3xl my-2">404 - page not found</p>
            <button className="rounded px-5 py-1 bg-blue-500 text-white my-3">Return to the home page</button>
            {/* <button className="rounded px-3 py-2 bg-blue-500 text-white">Add item</button>
            <p className="text-sm my-8">Result: {count}</p> */}
        </div>
    )
}

export default NotFound;
